import React from 'react'
import logo from "../assets/djezzy.png";

function HomeNav() {
    return (
        <div className="text-black flex justify-between items-center h-24 max-w-[1800px] mx-auto px-4">
            <img
                className=" object-scale-down h-30 w-20 pt-3.8"
                src={logo}
                alt="djeezy logo"
            />
            <ul className= "flex">
                <li className='p-4'>Accueil</li>
                <li className='p-4'>Contact</li>
            </ul>
        </div>
    );
}

export default HomeNav
